import { css } from '@emotion/react';

const styles = {
  income: css`
    border-bottom: 10px solid rgba(0, 255, 0, 0.5);
  `,
  expense: css`
    border: : 10px solid rgba(255, 0, 0, 0.5);
  `,
};

export default styles;
